// src/MessageParser.js
class MessageParser {
    constructor(props) {
        this.props = props; // Store the props
    }

    parse(message) {
        const { actionProvider } = this.props; // Correctly access actionProvider from props

        // Ensure that actionProvider is defined before using it
        if (actionProvider) {
            if (message.includes("hello")) {
                actionProvider.handleHello();
            } else if (message.includes("order")) {
                actionProvider.handleOrderStatus();
            } else {
                actionProvider.handleUnknown(); // This should now work if actionProvider is passed correctly
            }
        } else {
            console.error("actionProvider is undefined in MessageParser.");
        }
    }
}

export default MessageParser;
